// SPDX-License-Identifier: MIT
// In erc1155
pragma solidity ^0.8.0;

import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/token/ERC1155/ERC1155.sol';
import './Logger.sol';

//Rarible has seperate smarts contracts called the Royalties Registry that is used to track/set the royalties of each NFT.
import "./@rarible/royalties/contracts/impl/RoyaltiesV2Impl.sol";
import "./@rarible/royalties/contracts/LibPart.sol";
import "./@rarible/royalties/contracts/LibRoyaltiesV2.sol";

contract INERC1155 is ERC1155, Ownable, RoyaltiesV2Impl {
    //using Strings for uint256;
    
    string public baseURI;
    string _contractURI;
    uint256 countToken;
    uint256 baseCollectionPrice;
    address addressLoger;
    bool _lazyMint;
    bool pause;
    mapping(uint256 => string) private _tokenURI;
    bytes4 private constant _INTERFACE_ID_ERC2981 = 0x2a55205a;
    bytes16 public baseExtension = ".json";

    event Mints(address indexed _to, uint256 _tokenId, string uri, uint256 amount);

    constructor(string memory _initBaseURI, bool _lazy, address _addressLoger) ERC1155(_initBaseURI){//https://gateway.pinata.cloud/ipfs/QmTN32qBKYqnyvatqfnU8ra6cYUGNxpYziSddCatEmopLR/metadata/api/item/{id}.json
        //setBaseURI(_initBaseURI);
        _lazyMint = _lazy;
        addressLoger = _addressLoger;
    }

    function getLazyMint() external view returns (bool){
        return _lazyMint;
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC1155) returns (bool) {
        if(interfaceId == LibRoyaltiesV2._INTERFACE_ID_ROYALTIES) {
            return true;
        }
        if(interfaceId == _INTERFACE_ID_ERC2981) {
            return true;
        }
        return super.supportsInterface(interfaceId);
    }

    ///@dev for Opensea metadata
    function contractURI() public view returns (string memory) {
        return _contractURI;
    }

    ///@dev set metadata opensea
    function setContractURI(string memory _URI) external {
        _contractURI = _URI;
    }

    /*function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }*/

    function setRoyalties(
        uint256 _tokenId,
        address payable _royaltiesReceipientAddress,
        uint96 _percentageBasisPoints
    ) public onlyOwner {
        LibPart.Part[] memory _royalties = new LibPart.Part[](1);
        _royalties[0].value = _percentageBasisPoints;
        _royalties[0].account = _royaltiesReceipientAddress;
        _saveRoyalties(_tokenId, _royalties);
    }

    /**
    All functions using this modifier can only be called by the delegation contract
     */
    /*modifier byDelegate() {
        require((msg.sender == adressMarketPlace || adressMarketPlace == address(0))&& !paused,"Not good address delegate contract");
        _;
    }*/

    ///@dev Temporarily lock the contract
    function paused() external onlyOwner {
        pause=!pause;
    }

    function _mintTo(address _to,  string calldata _uri, uint256 _tokenId, uint256 _amount ) internal onlyOwner {
        if(_lazyMint==false){
            if (bytes(_tokenURI[_tokenId]).length == 0) {
                require(bytes(_uri).length > 0, "empty uri.");
                _tokenURI[_tokenId] = _uri;
            }

            _mint(_to, _tokenId, _amount, "");
            Logger(addressLoger)._Mints(address(this),countToken,_to, _amount,"ERC1155");
        }
    }

    function lazyMint(uint256 quantity, address _to, uint256 _tokenId) external onlyOwner {
        if(_lazyMint==true){
            _mint(_to,_tokenId, quantity, "");
            Logger(addressLoger)._Mints(address(this),_tokenId,_to, quantity,"ERC1155");
        }
    }
    
    /// @dev Returns the URI for a tokenId
    function uri(uint256 _tokenId) public view override returns (string memory) {
        return _tokenURI[_tokenId];
    }

    /**
    Burn a token (Useless for this project, but it's always good to have one)
     */
    function burn(address account, uint256 id, uint256 value ) external onlyOwner {
        _burn(account, id, value);
    }

    function _beforeTokenTransfer(
        address operator,
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) internal virtual override(ERC1155) {
        require(!pause, "Pausable: paused");
        super._beforeTokenTransfer(operator, from, to, ids, amounts, data);
        Logger(addressLoger)._TransferERC1155(operator, from, to, ids, amounts, block.number);
        // do stuff before every transfer
        // e.g. check that vote (other than when minted) 
        // being transferred to registered candidate
    }

}
